import React, { useState, useEffect } from "react";
import './myHistory.css';

function MyHistory({ activeMenu }) {
    const [message, setMessage] = useState(null);
    const [historyData, setHistoryData] = useState([]);
    const myArray = [{name:'x', id:1},{name:'y', id:2}];
    
    useEffect(() => {
      try{
        fetch('http://localhost:3001/history')
        .then((res) => res.json())
        .then((data) => {
          setHistoryData([data.history[0],data.history[1],data.history[2]]);
          console.log(typeof historyData);
        });
      }
      catch(err) {
        console.log(err);
      }
    }, [activeMenu==='My_history']);


    if (activeMenu === "My_history") {
      return (
        <div>
            <h2>my history</h2>
            <div className="table-container">
            <table border={1}>
              <thead>
                <tr>
                  <th>category</th>
                  <th>search</th>
                  <th>result</th>
                </tr>
              </thead>
              <tbody>
                {myArray.map((item) => (
                    <tr key={item._id}>
                      <td>{item.name}</td>
                      <td>{item.id}</td>
                      
                      {/* <td>{item.search}</td>
                      <td>{item.result}</td> */}
                    </tr>
                  
                ))}
              </tbody>
            </table>
          </div>
        </div>
        );
    }
}
export default MyHistory;
